  // Remove svg.radial-progress .complete inline styling
  $('svg.radial-progress').each(function( index, value ) { 
    $(this).find($('circle.complete')).removeAttr( 'style' );
  });


$(window).on("load", function() {
    "use strict";

    const observer = new IntersectionObserver(entries => {
      entries.forEach(entry => {
        const square = entry.target.querySelectorAll('.triggerAnm');
        
        square.forEach(sq => {
          let classList = $(sq).attr('data-anm');
          if (entry.isIntersecting) {
            $(sq).addClass(classList);
            return; 
          }
  
          $(sq).removeClass(classList);
        })

      });
    });
    
    $('.scrollAnm').each(function(i,e){
      observer.observe(e);
    });


  // CIRCULAR PROGRESS
  // Activate progress animation on scroll
  $(window).scroll(function(){
      $('svg.radial-progress').each(function( index, value ) { 
          // If svg.radial-progress is approximately 25% vertically into the window when scrolling from the top or the bottom
          if ( 
              $(window).scrollTop() > $(this).offset().top - ($(window).height() * 0.75) &&
              $(window).scrollTop() < $(this).offset().top + $(this).height() - ($(window).height() * 0.25)
          ) {
              // Get percentage of progress
              var percent = $(value).data('percentage');
              // Get radius of the svg's circle.complete
              var radius = $(this).find($('circle.complete')).attr('r');
              // Get circumference (2Ï€r)
              var circumference = 2 * Math.PI * radius;
              // Get stroke-dashoffset value based on the percentage of the circumference
              var strokeDashOffset = circumference - ((percent * circumference) / 100);
              // Transition progress for 1.25 seconds
              $(this).find($('circle.complete')).animate({'stroke-dashoffset': strokeDashOffset}, 1250);
          }
      });
  }).trigger('scroll');



  // Ever Care Video Section
    $(".everCareVideo").each(function(i, e){
      let img = $(e).find('img').innerHeight();
      $(e).parents('.row').eq(0).css('min-height', img );
    });

    // Accordions Functionality
    $(document).on("click", ".accordion_title", function (e) {
        $(this).toggleClass('active');
        
        $(this).find('ion-icon').attr('name') === "chevron-up-outline" ? 
        $(this).find('ion-icon').attr('name', 'chevron-down-outline') : 
        $(this).find('ion-icon').attr('name', 'chevron-up-outline') ;
        
        $(this).siblings(".accordion_content").slideToggle("fast");
        return false;
    });    




    //Curve Backgroun
    $(".curve_bg").prepend(`<svg class="curve_img" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 1920 373">
    <image id="Background" width="1920" height="373" xlink:href="data:img/png;base64,"/>
    <image width="1920" height="373" xlink:href="data:img/png;base64,"/>
  </svg>`);


  //Responsive Menu Hamburger
  const element = document.getElementById("hamburger");
  element.onclick = () => {
    if (element.classList.contains("x")) {
      element.classList.remove("x");
      $(".responsiveNavigation").removeClass('show')
    } else {
      $(".responsiveNavigation").addClass('show')
      element.classList.add("x");
    }
  };


  /*================== Responsive Menu Dropdown =====================*/
  $(".responsiveNavigation ul ul").parent().addClass("menu-item-has-children");
  $(document).on("click", ".responsiveNavigation ul li.menu-item-has-children > a", function() {
      $(this).parent().toggleClass("active").siblings().removeClass("active");
      $(this).next("ul").slideToggle();
      $(this).parent().siblings().find("ul").slideUp();
      return false;
  });    
      
  
  /*================== Donation Select Amount =====================*/
  $(document).on('click','.select_amount span', function(e){
    $(this).addClass('active').siblings().removeClass('active');
    $("#donation_amount").val($(this).attr('data-value'));
  });


  /*================== Update Amount With Plus Minus =====================*/
  $(document).on('click','.updateAmount', function(e){
    var currentVal = $("#donation_amount").val();
    $(this).attr('id') == 'low' ?
    $("#donation_amount").val(currentVal - 1) : 
    $("#donation_amount").val(parseInt(currentVal) + 1)  
  })



  /*================== Initialize Fancy Box Plugin =====================*/
  Fancybox.bind('[data-fancybox="gallery"]', {
    Toolbar: true,
    animated: true,
    dragToClose: true,
    closeButton: "top",
    Thumbs: {
      minScreenHeight: 0,
    },
  });

  
});
